import React from 'react';
import OrderTracker from '../components/OrderTracker';

function TrackOrder() {
  return (
    <div className="min-h-screen bg-gradient-to-br from-navy via-slate-800 to-slate-900 py-8">
      <OrderTracker />
    </div>
  );
}

export default TrackOrder;
